@import './normalize.css';

html{
    font-size: 62.5%;
    scroll-behavior: smooth;
}

:root{
    --color-primary:#fff;
    --color-secondary:#262622;
    --color-accent:#BF6341;
    --color-brown:#BF8F54;
} 

*,
*::after,
*::before {
  box-sizing: border-box;
}

a{
    text-decoration: none;
    color:var(--color-secondary);
}

.container{
    max-width:1440px;
    margin:0 auto;
}

body{
    font-family: 'Open Sans', Arial, Helvetica, sans-serif;
    color:#fff;
    font-size:1.563rem;
    line-height:1.5;
    font-weight: 300;
}

h1,
h2,
h3{
    font-family: 'Roboto', Arial, Helvetica, sans-serif;
    margin-bottom: 1rem;
}

h4{
    font-family: 'Open Sans', Arial, Helvetica, sans-serif;
    font-weight: 300;
}

h1{
    color:#fff;
}

h2,h3,h4{
    color:var(--color-secondary);
}

h1{
    font-size: 3.052rem;
}
h2{
    font-size:3rem;
    letter-spacing: 0.1rem;
}
h3{
    font-size:2.5rem;
}

h4{
    font-size:1.8rem;
    line-height: 1.4;
}

.lead{
    font-size: 1.563rem;
}

.lead-second{
    font-size:1.2rem;
    white-space: nowrap;
    text-align: center;
    margin:2rem auto;
}

.strong{
    font-weight: 700;
}

.bold{
    font-weight: 400;
}

.secondary{
    color:var(--color-secondary);
}

.primary{
    color:var(--color-primary);
}

.accent{
    color:var(--color-accent);
}


@media screen and (min-width:600px){
    body{
        font-size:2rem;
    }
    h1{
        font-size:6rem;
    }
    h2{
        font-size:3.998rem;
    }
    h3{
        font-size:2.827rem;
    }
    h4{
        font-size:2.6rem;
    }

    .lead{
        font-size: 2rem;
    }
    .lead-second{
