        font-size:10rem;
    }
    h2{
        font-size:4.5rem;
    }
    h3{
        font-size:3.375rem;
    }
    h4{
        font-size:2.4rem;
        line-height: 2;
    }
    .lead{
        font-size: 2.2rem;
    }
    .lead-second{
        font-size:2rem;
        letter-spacing: 2px;
    }
}

