    border: 3px solid #26262283;
}
}

/* block */

.block{
    --padding-vertical:6rem;
    padding:var(--padding-vertical) 2rem;
}

.block__header{
    text-align: center;

}

.block__footer{
    padding-bottom:10rem;
}

/* margin */

.margin--block{
    margin:0 2rem;
  }

.margin-bottom--small{
    margin-bottom:1.5rem;
}

/* padding */
.padding-top--block{
    padding-top: 3rem;
}

/* text-align */

.text-align--left{
  text-align:left;
}  

