    padding-left:0;
}

@media screen and (min-width:768px){
    .list__tablet{
        list-style: outside;
    }
}

.list__content{
    margin-top:0;
    padding-left:0;
}

/* nav */

.nav__brand{
    padding-top: 0.5rem;
    padding-left:1rem;
}
.nav__logo{
    width:4rem;
    height:4rem;
}

.nav{
    display:flex;
    justify-content: space-between;
    flex-wrap:wrap;

    align-items: center;
font-weight: 400; 
    text-transform: uppercase;
align-items:center;
width:100vw;
background-color: #f2eeeb37;
}



.nav__list{
    width:100%;
    margin:0;
}

.nav__item{
    padding:1.5rem 2rem;
    border-bottom: 0.2px solid var(--color-primary);

}

.nav__item>a{
    color:#262622;
}

.nav__item:hover>a{
    color:var(--color-primary);
    transition:color 0.3s;
}

.nav__item:hover{
    background-color: var(--color-accent);
}

.nav__toggler{
    opacity:1;
    cursor:pointer;
  position:absolute;
  top:2px;
  right:0;
  margin:0.6rem 0.8rem 0 ;
fill:var(--color-accent); 
  transition:all 0.15s;
}

.nav__toggler__close{
    opacity:0;
   width: 25px;
   margin:1rem 1.6rem 0 ;
   fill:#fff;
}

.nav.collapsible--expanded .nav__toggler{
    opacity:0; 
    fill:#fff;
}
.nav.collapsible--expanded .nav__toggler__close{
    opacity:1; 
    fill:var(--color-accent);

}

@media screen and (min-width:768px){


    .nav__toggler, .nav__toggler__close{
        display:none;
    }



    .nav__list{
        max-height:100%;
        opacity: 1;
        display:flex;
        width:auto;
    }

    .nav__item:hover>a{
        color:var(--color-primary);
    }

    .nav__item:hover{
        background-color: var(--color-accent);
        transition:background-color 0.3s;
    }

    .nav-bottom-border{
        border-bottom: 0.5px solid var(--color-primary);
